import React from 'react';

const Header = () => {
    return (
<div className="App-header">
				<a
					className='App-link'
					href='https://reactjs.org'
					target='_blank'
					rel='noopener noreferrer'
				>
					click here for help lol
				</a>
<p>
This is a demo app.  You set a timer, and if the timer runs out it texts somebody with your location.  
Unfortunately the location doesn't work, and this is done in React, not React Native.



</p>
</div>


    );
};

export default Header;
